import { CHANGE_OFF, CHANGE_ON } from "./types";

export function changeOn() {
  return {
    type: CHANGE_ON,
    text: "SAVE",
  };
}

export function changeOff() {
  return {
    type: CHANGE_OFF,
    text: "IZMENA",
  };
}
